angular.module("OODLib").run(["$templateCache",function(a){a.put("lib/aside/aside.html",'<div class="linedk"> <ul> <li ng-repeat="(k, v) in model.data"><a ng-href="{{v.URL}}" ng-click="model.toggle(k)"><i ng-class="v.icon"></i>{{v.name}}<i ng-class="css.arrowIcon(model.expansion, k)"></i></a> <ul ng-show="model.expanded(k)"> <li ng-repeat="subnode in v.subnodes"><a ng-href="{{subnode.URL}}"><i ng-class="subnode.icon"></i>{{subnode.name}}</a></li> </ul> </li> </ul> </div>'),a.put("lib/footer/footer.html",'<footer> <p>Copyright © {{model.data.year}} {{model.data.name}}<span>|</span><a ng-href="{{model.data.website}}">{{model.data.websiteName}}</a><span>|</span>version: {{model.data.version}} {{model.data.status}}</p> </footer>'),a.put("lib/table/table.html",'<div class="responsive"> <table class="table table-sort table-detail-default table-stripped-4"> <thead> <tr> <th ng-repeat="t in model.columnFields" ng-click="model.sortBy(t)"> <span ng-bind="model.getTitle(t)"></span><i ng-class="css.sortState(model.sort, t)" class="fa"></i></th> </tr> </thead> <tbody> <tr ng-repeat-start="item in model.currentData" ng-click="model.toggleDetail($index)" ng-class="css.brief(item)"> <td ng-repeat="(k,v) in item.columnData" ng-class="css.td(item.columnData)"> <div ng-class="css.cell(k,v)"><i ng-class="css.cellIcon(k,v)"></i><span ng-bind="v" class="css.cellContent(k,v)"></span></div> </td> </tr> <tr ng-repeat-end="ng-repeat-end" ng-show="model.detailDisplayed($index)" ng-class="css.detail(item)"> <td colspan="{{model.columnFields.length}}" class="is-nopadding"> <div class="detail-default"> <div translate="translate" class="detail-title">details</div> <dl> <dt ng-repeat-start="(k,v) in item.detailData" ng-bind="model.getTitle(k)">:</dt> <dd ng-repeat-end="(k,v) in item.detailData">{{v}}</dd> </dl> </div> </td> </tr> </tbody> </table> <div class="statistics"> <span> <span translate="translate">total</span><span ng-bind="model.data.length"> </span><span translate="translate">records</span></span> <ul class="pagination"> <li ng-class="css.prevPageState(model.currentPage)" ng-click="model.setCurrentPage(model.currentPage-1)"><a href="#">«</a></li> <li ng-repeat="i in model.pageRange" ng-click="model.setCurrentPage(i)" ng-class="css.pageState(model.currentPage, i)"><a href="#">{{i}}</a></li> <li ng-class="css.nextPageState(model.currentPage, model.numPages)" ng-click="model.setCurrentPage(model.currentPage+1)"><a href="#">»</a></li> </ul> </div> </div>'),a.put("lib/topbar/topbarDropdown.html",'<ul class="dropdown-menu"> <li class="header">{{ model.data.name }}</li> <li> <ul class="menu"> <li ng-repeat="(k, v) in model.data"><a ng-href="{{v.URL}}" ng-click="model.toggle(k)"><i ng-class="v.icon" class="floatLeft"><span class="floatLeft"><small class="topBar_small"></small></span><span class="floatLeft">{{ v.name }}<small ng-bind="v.count" class="topBar_small_chrono"></small></span></i><i ng-class="css.arrowIcon(model.expansion, k)"></i> <ul ng-show="model.expanded(k)"> <li ng-repeat="(k, v) in v.subnodes">{{ k }}:&nbsp;&nbsp;{{ v }}</li> </ul></a></li> </ul> </li> <li class="footer"> <ul> <li ng-repeat="(k, v) in model.data.footerInfo">{{ k }}:&nbsp;&nbsp;{{ v }}</li> </ul> </li> </ul>')}]);